import * as React from 'react';
import { useState, useEffect } from 'react';
import {Box, TextField, InputLabel, Select, MenuItem, FormControl, InputAdornment, OutlinedInput} from '@mui/material';

export default function FormPropsTextFields() {
  const [firstName, setfFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [typeOfDonation, setTypeOfDonation] = useState("");


  const handleTypeOfDonationChange = (event) => setTypeOfDonation(event.target.value)
  const handleFirstnameChange = (event) => setfFirstName(event.target.value)
  const handleLastnameChange = (event) => setLastName(event.target.value)

  return (
    <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      validate
      autoComplete="off"
      >
      <div>
        <TextField
          required
          id="outlined-required"
          label="First name"
          placeholder="first name"
          onChange={handleFirstnameChange}
        />
        <TextField
          required
          id="outlined-required"
          label="Last name"
          placeholder="last name"
          onChange={handleLastnameChange}
          />
      </div>

      <div>
      <FormControl sx={{ m: 1, minWidth: "25ch" }}>
          <InputLabel id="demo-simple-select-label">Type of donation</InputLabel>
          <Select
            required
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={typeOfDonation}
            label="Type of donation"
            onChange={handleTypeOfDonationChange}
          >
            <MenuItem value={"money"}>money</MenuItem>
            <MenuItem value={"food"}>food</MenuItem>
            <MenuItem value={"clothing"}>clothing</MenuItem>
            <MenuItem value={"etc."}>etc.</MenuItem>
          </Select>
        </FormControl>
      </div>

      <div>
        <FormControl sx={{ m: 1, minWidth: "25ch" }}>
          <InputLabel htmlFor="outlined-adornment-amount">Amount</InputLabel>
          <OutlinedInput
            id="outlined-adornment-amount"
            type='number'
            startAdornment={<InputAdornment position="start">$</InputAdornment>}
            label="Amount"
            />
        </FormControl>

        <FormControl sx={{ m: 1, minWidth: "25ch" }}>
          <InputLabel htmlFor="outlined-adornment-amount">Item quantity of articles</InputLabel>
          <OutlinedInput
            type='number'
            id="outlined-adornment-amount"
            label="Items quantity"
          />
        </FormControl>
      </div>
    </Box>
    // <Box>
    // </Box>

  );
}
